import moment from 'moment';
import React from 'react';


const Weekday = () =>{
    weekdayshort = moment.weekdaysShort();
    let weekdayshortname = this.weekdayshort.map(day => {
        return (
            <th key = {day} className = "week-day">{day}</th>
        );
    })
}

export default Weekday;
